def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    group_axis = obj._get_axis(axis)

    if level is not None:
        if isinstance(group_axis, MultiIndex):
            if is_list_like(level) and len(level) == 1:
                level = level[0]

            if key is None and is_scalar(level):
                key = group_axis.get_level_values(level)
                level = None

        else:
            if is_list_like(level):
                nlevels = len(level)
                if nlevels == 1:
                    level = level[0]
                elif nlevels == 0:
                    raise ValueError("No group keys passed!")
                else:
                    raise ValueError("multiple levels only valid with MultiIndex")

            if isinstance(level, (str, int)):
                if isinstance(level, str) and obj.index.name != level:
                    raise ValueError(
                        f"level name {level} is not the name of the index"
                    )
                elif isinstance(level, int) and not (-1 <= level < obj.index.nlevels):
                    raise ValueError("level must be within the bounds of the index")

            level = None
            key = group_axis

    if isinstance(key, Grouper):
        binner, grouper, obj = key._get_grouper(obj, validate=False)
        if key.key is None:
            return grouper, [], obj
        else:
            return grouper, {key.key}, obj

    elif isinstance(key, BaseGrouper):
        return key, [], obj

    if not is_list_like(key):
        keys = [key]
        match_axis_length = False
    else:
        keys = key
        match_axis_length = len(keys) == len(group_axis)

    groupings = []
    exclusions = []

    for k, level in zip(keys, [level] * len(keys)):
        if not _is_label_like(k):
            if k not in group_axis:
                raise KeyError(f"Key {k} not found in axis")

        gpr = group_axis.get_indexer_for(k) if isinstance(k, list) else k
        ping = Grouping(
            obj,
            gpr,
            name=k,
            level=level,
            sort=sort,
            observed=observed,
            in_axis=True,
        )
        groupings.append(ping)

    if len(groupings) == 0 and len(obj):
        raise ValueError("No group keys passed!")

    grouper = BaseGrouper(group_axis, groupings, sort=sort, mutated=mutated)
    return grouper, exclusions, obj
